import React from 'react';
import EditCard from './edit-card';
import Books from '../../Books';

class AdminList extends React.Component{
    render(){
        return(
             Boosk.map(b=><EditCard cover={b.cover} title={b.title} />)
        );
    }
}

export default  AdminList;
